public class InnerWebACLRuleActionFactory(Action<Humidifier.WAFv2.WebACLTypes.RuleAction> factoryAction = null) : SubResourceFactory<Humidifier.WAFv2.WebACLTypes.RuleAction>
{

    internal InnerWebACLCaptchaActionFactory CaptchaFactory { get; set; }

    internal InnerWebACLBlockActionFactory BlockFactory { get; set; }

    internal InnerWebACLCountActionFactory CountFactory { get; set; }

    internal InnerWebACLAllowActionFactory AllowFactory { get; set; }

    internal InnerWebACLChallengeActionFactory ChallengeFactory { get; set; }

    protected override Humidifier.WAFv2.WebACLTypes.RuleAction Create()
    {
        var ruleActionResult = CreateRuleAction();
        factoryAction?.Invoke(ruleActionResult);

        return ruleActionResult;
    }

    private Humidifier.WAFv2.WebACLTypes.RuleAction CreateRuleAction()
    {
        var ruleActionResult = new Humidifier.WAFv2.WebACLTypes.RuleAction();

        return ruleActionResult;
    }
    public override void CreateChildren(Humidifier.WAFv2.WebACLTypes.RuleAction result)
    {
        base.CreateChildren(result);

        result.Captcha ??= CaptchaFactory?.Build();
        result.Block ??= BlockFactory?.Build();
        result.Count ??= CountFactory?.Build();
        result.Allow ??= AllowFactory?.Build();
        result.Challenge ??= ChallengeFactory?.Build();
    }

} // End Of Class

